lyrics:
//Varón de guerra es Jehová;

Jehová es su nombre//.



Grande y fuerte es Jehová;

Jehová es su nombre

No conoce la derrota;

Jehová es su nombre

Ni sabe que es el miedo;

Jehová es su nombre

Temible en batalla;

Jehová es su nombre

Grande en loor.

